import React from "react";
import { Link } from "react-router-dom";
const Navbar=()=>
{
    return(
        <nav>
            <div className="navbar">
                <Link to='/' className="navite">Home</Link>
                <Link to='/about'>About</Link>
                <Link to='/contact'>Contact Us</Link>
            </div>
        </nav>
    )
}
export default Navbar;
